     {"title": "User_Interface", "text": " Added Suspend/Resume events Added command key handling Split activate/deactivate event handling New menu item -&gt; hide windows in background Save screen if hiding windows, otherwise don't - speed up context switching Enabled desk accessories Added bad disk handling Split up HandleMenu <a class=\"normal\" href=\"MacPascal.Proc.html\">proc</a> into several procedures - one per menu Added named constants for menu items (so ordinary mortals like me can read this!) All file operations converted to Mac file manager calls DLOGs for DireMessages changed to Alerts, conforming to Apple's HIG Removed Repeat/Until loops around save changes alerts Removed many unused variables, and restricted USE of other units Added auto positioning of dialogs and alerts under System 6 (urgh). Added auto position to resources for System 7 Saving files in same folder as file with same name now removes old file, even if open (not sure of the wisdom of this, though)  <p>&mdash;&mdash;&mdash;&mdash;&mdash;&mdash;&mdash;&mdash;&mdash;&mdash;&mdash;&mdash;&mdash;&mdash;&mdash;&mdash;&mdash;&mdash;&mdash;&mdash;&mdash;&mdash;&mdash;&mdash;&mdash;&mdash;&mdash;&mdash;&mdash;&mdash;- TO DO Check out other dialogs, some of them should be alerts (done) Offscreen bitmaps: 1. Save only <a class=\"normal\" href=\"MacPascal.Rect.html\">rect</a> of dialog or alert 2. Don't save screen before switching out (makes response sluggish - Apple says don't do it 3. Change DoUpdate so that it draws normally if no offscreen saved 4. Remove spurious calls to <a class=\"normal\" href=\"Miscellaneous.html#StoreOffScreen\">StoreOffScreen</a> 5. Disentangle activate and update event handling Restrict window <a class=\"normal\" href=\"MacPascal.Size.html\">size</a>, and allow users to change <a class=\"normal\" href=\"MacPascal.Size.html\">size</a>. Option: leave space for disk icons Add support for <a class=\"normal\" href=\"Globals.html#a\">a</a> least the required set of Apple Events  <p>) ", "tags": "", "loc": "User_Interface.html"},
     {"title": "User_Interface.HandleEvent", "text": "    ", "tags": "", "loc": "User_Interface.html#HandleEvent"}
